class mazeNode{
	constructor(xVal , yVal){
		this.xVal = xVal;
		this.yVal = yVal;
	}

	getYVal(){
		return this.yVal;
	};

	getXVal(){
		return this.xVal;
	};

	setXVal(newXVal){
		this.xVal = newXVal;
	};

	setYVal(newYVal){
		this.yVal = newYVal;
	};
}
module.exports = mazeNode;
